import React from 'react';
import DashboardIcon from "@material-ui/icons/Dashboard";

export const SidebarData = [
  {
    title: 'Dashboard',
    path: '/',
    icon: <DashBoardIcon/>,
    cName: 'nav-text'
  },
  {
    title: 'Reports',
    path: '/reports',
    cName: 'nav-text'
  },
  {
    title: 'Products',
    path: '/products',
    cName: 'nav-text'
  },
  {
    title: 'Team',
    path: '/team',
    cName: 'nav-text'
  },
  {
    title: 'Messages',
    path: '/messages',
    cName: 'nav-text'
  },
  {
    title: 'Support',
    path: '/support',
    cName: 'nav-text'
  }
];
